window.bookSummaryJSON = "Nancy Springer is the two-time Edgar Award-winning, <i>New York Times</i> best-selling author of <i>The Case of the Left- Handed Lady</i>. <p> Dr. Watson, the right-hand man of master sleuth Sherlock Holmes, has gone missing. This prompts Sherlock to enlist the assistance of Enola Holmes, his intrepid younger sister. She investigates Watson's home just in time to witness the arrival of a bizarre bouquet blooming with convolvulus, hawthorn, and white poppies - flowers that symbolize death!</p>"; 
